export default function RedirectButton({redirectTo, text}) {
  return (

    <Router>
     <Link to={redirectTo}>
      <Button renderAs="button">
        <span>{text}</span>
      </Button>
    </Link>
      
      <Switch>
          <Route path={redirectTo} component={redirectTo} />
      </Switch>
  </Router>
    



  );
}
